const kill_gsap_triggers = () => {
	if (window.codepoet.debug) {
		console.log("killing scroll trigger");
	}
	let existingScrollTriggers = ScrollTrigger.getAll();
	for (let index = 0; index < existingScrollTriggers.length; index++) {
		const singleTrigger = existingScrollTriggers[index];
		singleTrigger.kill(false);
	}
};

function home_image_panels() {
	if (jQuery(".section2 .panel").length) {
		if (window.codepoet.debug) {
			console.log("Home panels vertical");
		}
		const panels = gsap.utils.toArray(".section2 .panel");
		const totalPanels = panels.length;
		let crop = document.getElementsByClassName("crop")[0];

		panels.forEach((panel, i) => {
			ScrollTrigger.create({
				trigger: panel,
				start: "top top",
				endTrigger: ".section2",
				end: "bottom 100%",
				pin: true,
				pinType: "fixed",
				markers: window.codepoet.debug,
				pinSpacing: false,
				preventOverlaps: true,
				fastScrollEnd: true,
				anticipatePin: 1,
				onEnter: ({ progress, direction, isActive }) => {
					if (progress != 1) {
						crop.classList.add("active");
					}
				},
				onLeave: ({ progress, direction, isActive }) => {
					if (progress == 1) {
						crop.classList.remove("active");
					}
				},
				onEnterBack: ({ progress, direction, isActive }) => {
					if (i === totalPanels - 1) {
						crop.classList.add("active");
					}
				},
				onLeaveBack: ({ progress, direction, isActive }) => {
					if (!isActive && i === 0) {
						crop.classList.remove("active");
					}
				},
			});
		});
	}
}

