function home_slider() {
	if (jQuery("#slides_horizontal_container").length) {
		if (window.codepoet.debug) {
			console.log("Home panels horizontal");
		}
		let firstBgColor = jQuery("#slides_horizontal .panel")
			.first()
			.data("bgcolor");

		gsap.to("#sections_end", {
			backgroundColor: firstBgColor,
		});

		const panelsSection = document.querySelector("#slides_horizontal");
		const panelsContainer = document.querySelector(
			"#slides_horizontal_container"
		);
		const panels = gsap.utils.toArray(
			"#slides_horizontal_container .panel"
		);
		const panelCount = panels.length;

		gsap.to(panels, {
			xPercent: -100 * (panels.length - 1),
			ease: "none",
			scrollTrigger: {
				trigger: "#slides_horizontal_container",
				pin: true,
				start: "50% 50%",
				scrub: true,
				snap: false,
				end: () =>
					"+=" + (panelsContainer.offsetWidth - window.innerWidth),
			},
		});

		gsap.utils
			.toArray("#slides_horizontal .color")
			.forEach(function (elem, i) {
				let bgcolor = elem.getAttribute("data-bgcolor"),
					color = elem.getAttribute("data-color");

				ScrollTrigger.create({
					trigger: elem,
					toggleClass: "active",
					scrub: true,
					start: () => {
						let start_item =
							elem.offsetLeft - window.innerWidth / 2;
						let start = "top top-=" + start_item;
						if (Foundation.MediaQuery.is("medium down")) {
							start = "50% 70%-=" + elem.offsetLeft;
						}
						return start;
					},
					end: () => "+=" + elem.offsetWidth,
					onEnter: () =>
						triggerHomeColorChange(color, bgcolor, i, panelCount),
					onLeave: () =>
						triggerHomeColorChange(color, bgcolor, i, panelCount),
					onLeaveBack: () =>
						triggerHomeColorChange(color, bgcolor, i, panelCount),
					onEnterBack: () =>
						triggerHomeColorChange(color, bgcolor, i, panelCount),
				});
			});

		jQuery("#slides_horizontal .panel").on("click", function (event) {
			let link = jQuery(this).data("link");
			if (link) {
				barba.go(link);
			}
		});
	}
}

function triggerHomeColorChange(color, bgcolor, i, panelCount) {
	let currentSlide = i + 1,
		currentPercentage = (100 / panelCount) * currentSlide;

	gsap.to("#sections_end", {
		duration: 0.5,
		backgroundColor: bgcolor,
	});

	gsap.to("#indicator", {
		width: currentPercentage + "%",
	});
}

