function load_more_blog(next) {
	var loadMoreButtonCheck = jQuery(next.html).find("#blog_list #load_more");
	if (loadMoreButtonCheck.length) {
		if (window.codepoet.debug) {
			console.log("blog button found");
		}

		let loadMoreButton = jQuery("#blog_list #load_more");

		var loadPosts = function (page) {
			var theData, loadMoreContainer, errorStatus, errorMessage;

			jQuery.ajax({
				url: site_vars.load_more_posts,
				dataType: "json",
				data: {
					per_page: loadMoreButton.data("perpage"),
					page: page,
					_fields: ["rendered_html", "title"],
					lang: site_vars.current_lang,
					category:
						loadMoreButton.data("cat") != "no"
							? loadMoreButton.data("cat")
							: "",
				},
				beforeSend: function () {
					loadMoreButton.addClass("loading");
				},
				success: function (data, textStatus, request) {
					if (request.getResponseHeader("x-wp-totalpages") == page) {
						loadMoreButton.remove();
					} else {
						loadMoreButton.removeClass("loading");
					}

					theData = [];

					for (i = 0; i < data.length; i++) {
						theData[i] = {};
						theData[i].html = data[i].rendered_html;
					}

					loadMoreContainer = jQuery("#blog_items");

					jQuery.each(theData, function (i) {
						loadMoreContainer.append(theData[i].html);
					});
				},
				error: function (jqXHR, textStatus, errorThrown) {
					errorStatus = jqXHR.status + " " + jqXHR.statusText + "\n";
					errorMessage = jqXHR.responseJSON.message;

					console.log(errorStatus + errorMessage);
				},
			});
		};

		loadPosts(1);

		var getPage = 2;

		loadMoreButton.on("click", function () {
			loadPosts(getPage);
			getPage++;
		});
	}
}

