function init_portolio_list(next) {
	let portfolio = jQuery(next.container).find("#projects_slider");
	if (portfolio.length > 0) {
		if (window.codepoet.debug) {
			console.log("Portfolio carousel");
		}

		let word_scroll = false,
			word1 = false,
			word2 = false,
			negativeSpaceWord1 = false,
			negativeSpaceWord2 = false,
			windowWidth = window.innerWidth;

		if (next.container.getElementsByClassName("word_scroll").length) {
			let fitties = fitty(".word_scroll", {
				maxSize: 230,
				minSize: 60,
			});

			jQuery(".word_scroll").on("fit", function (event) {
				jQuery(this).addClass("fitted");

				word1 = next.container.getElementsByClassName("word1Text");
				word2 = next.container.getElementsByClassName("word2Text");

				negativeSpaceWord1 = word1
					? windowWidth -
					  word1[0].offsetWidth -
					  parseInt(
							window
								.getComputedStyle(
									word1[0].parentNode.closest(
										".word_scroll_wrap"
									),
									null
								)
								.getPropertyValue("padding-left")
					  )
					: false;
				negativeSpaceWord2 = word2
					? windowWidth -
					  word2[0].offsetWidth -
					  parseInt(
							window
								.getComputedStyle(
									word2[0].parentNode.closest(
										".word_scroll_wrap"
									),
									null
								)
								.getPropertyValue("padding-right")
					  )
					: false;
				word_scroll = true;
			});

			if (!window.codepoet.portfolioResizeEvent) {
				window.codepoet.portfolioResizeEvent = function () {
					windowWidth = window.innerWidth;
					negativeSpaceWord1 = word1
						? windowWidth -
						  word1[0].offsetWidth -
						  parseInt(
								window
									.getComputedStyle(
										word1[0].parentNode.closest(
											".word_scroll_wrap"
										),
										null
									)
									.getPropertyValue("padding-left")
						  )
						: false;
					negativeSpaceWord2 = word2
						? windowWidth -
						  word2[0].offsetWidth -
						  parseInt(
								window
									.getComputedStyle(
										word2[0].parentNode.closest(
											".word_scroll_wrap"
										),
										null
									)
									.getPropertyValue("padding-right")
						  )
						: false;
					word_scroll = true;
				};

				window.addEventListener(
					"resize",
					window.codepoet.portfolioResizeEvent
				);
			}
		}

		window.codepoet.portfolioSlider = new KeenSlider(
			"#projects_slider",
			{
				loop: false,
				rubberband: false,
				mode: "free",
				selector: ".keen-slider__slide",
				created: (instance) => {
					document.body.classList.add("portfolioLoaded");
					instance.container.classList.add("ready");
					window.scrollTo(0, 0);
					fitty.fitAll();
				},
				destroyed: (instance) => {
					document.body.classList.remove("portfolioLoaded");
				},
				detailsChanged: (instance) => {
					let progress = instance.track.details.progress;
					if (progress > 1) {
						progress = 1;
					}
					if (progress < 0) {
						progress = 0;
					}

					// Scrolling words
					if (word_scroll) {
						if (word1) {
							let progressWord1 = negativeSpaceWord1 * progress;
							word1[0].style.transform =
								"translateX(" + progressWord1 + "px)";
						}
						if (word2) {
							let progressWord2 = negativeSpaceWord2 * progress;
							word2[0].style.transform =
								"translateX(-" + progressWord2 + "px)";
						}
					}

					// Progress bar
					let progressBar = document.getElementById(
						"project_progressbar"
					);
					if (progressBar) {
						let progressBar = document
							.getElementById("project_progressbar")
							.getElementsByClassName("progress")[0];

						progressPercent = progress * 100 - 100;

						progressBar.style.transform =
							"translateX(" + progressPercent + "%)";
					}
				},
				slides: {
					origin: "auto",
					perView: 2.75,
					spacing: 30,
				},
				breakpoints: {
					"(max-width: 639px)": {
						disabled: true,
						created: (instance) => {
							document.body.classList.remove("portfolioLoaded");
							instance.container.classList.add("ready");
						},
					},
					"(min-width: 640px) and (max-width: 1023px)": {
						slides: {
							origin: "auto",
							perView: 1,
							spacing: 0,
						},
					},
					"(min-width: 640px) and (max-width: 1023px) and (hover: none)": {
						mode: "snap",
						rubberband: true,
						slides: {
							origin: "auto",
							perView: 1,
							spacing: 0,
						},
					},
					"(min-width: 1024px) and (max-width: 1199px)": {
						slides: {
							origin: "auto",
							perView: 2,
							spacing: 50,
						},
					},
					"(min-width: 1024px) and (max-width: 1199px) and (hover: none)": {
						mode: "snap",
						rubberband: true,
						slides: {
							origin: "auto",
							perView: 2,
							spacing: 50,
						},
					},
					"(min-width: 1200px) and (hover: none)": {
						mode: "snap",
						rubberband: true,
					},
				},
			},
			[WheelControlsKeenSlider, ResizePluginKeenSlider]
		);
	}
}

function WheelControlsKeenSlider(slider) {
	var touchTimeout;
	var position;
	var wheelActive;

	function dispatch(e, name) {
		position.x -= e.deltaX;
		position.y -= e.deltaY;
		slider.container.dispatchEvent(
			new CustomEvent(name, {
				detail: {
					x: position.y,
					y: position.x,
				},
			})
		);
	}

	function wheelStart(e) {
		position = {
			x: e.pageX,
			y: e.pageY,
		};
		dispatch(e, "ksDragStart");
	}

	function wheel(e) {
		dispatch(e, "ksDrag");
	}

	function wheelEnd(e) {
		dispatch(e, "ksDragEnd");
	}

	function eventWheel(e) {
		e.preventDefault();

		if (!wheelActive) {
			wheelStart(e);
			wheelActive = true;
		}

		wheel(e);
		clearTimeout(touchTimeout);
		touchTimeout = setTimeout(() => {
			wheelActive = false;
			wheelEnd(e);
		}, 50);
	}

	slider.on("created", () => {
		document.body.addEventListener("wheel", eventWheel, {
			passive: false,
		});
		slider.container.addEventListener("wheel", eventWheel, {
			passive: false,
		});
	});

	slider.on("destroyed", () => {
		document.body.removeEventListener("wheel", eventWheel);
	});
}

function ResizePluginKeenSlider(slider) {
	const observer = new ResizeObserver(function () {
		slider.update();
	});

	slider.on("created", () => {
		observer.observe(slider.container);
	});
	slider.on("destroyed", () => {
		observer.unobserve(slider.container);
	});
}

